import { createRouter, createWebHistory } from 'vue-router'

const routes = [
  {
    path: '/',
    name: 'dashboard',
    component: () => import('../views/Dashboard/Dashboard.vue')
  },
  {
    path: '/door-monitor',
    name: 'doorMonitor',
    component: () => import('../views/DoorMonitor/DoorMonitor.vue')
  },
  {
    path: '/work-order',
    name: 'workOrder',
    component: () => import('../views/WorkOrder/WorkOrder.vue')
  },
  {
    path: '/owner-management',
    name: 'ownerManagement',
    component: () => import('../views/OwnerManagement/OwnerManagement.vue')
  },
  {
    path: '/visitor',
    name: 'visitor',
    component: () => import('../views/Visitor/Visitor.vue')
  },
  {
    path: '/appointment',
    name: 'appointment',
    component: () => import('../views/Appointment/Appointment.vue')
  },
  {
    path: '/parking',
    name: 'parking',
    component: () => import('../views/Parking/Parking.vue')
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
